import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
} from 'react-router-dom';
import UnderStr from './underStrc';
import Section from './manager-sec';

const Main = () => {
  return (
    <div className="section-cont">
    <Switch>
      <Route path={'/manager/add'}>
        <UnderStr />
      </Route>
      <Route path={'/manager'}>
        <Section />
      </Route>
    </Switch>
    </div>
  );
}

export default Main;
